import React from "react";
import Post from "./Post/Post";
import { useSelector } from "react-redux";

const Posts = () => {

    const posts = useSelector((state) => state.posts);
    console.log(posts);
    return (
        <>
        {
            posts.map(
                post => {
                    return <Post post={post}/>
                }
            )
        }
        </>
    )
}

export default Posts;
